// src/components/ProfileForm.js

import React, { useState } from 'react';
import { TextField, Button, Typography } from '@mui/material';
import { styled } from '@mui/system';

// Custom background container that stretches across the entire width and height
const FullWidthBackground = styled('div')({
  backgroundColor: 'rgb(249, 245, 235)', // Off-white background
  height: '100vh',
  width: '100vw',
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
});

// Custom form container with padding and centered content
const FormContainer = styled('div')({
  maxWidth: '600px', // Adjusted to be slightly wider than the login form
  width: '100%',
  padding: '20px',
  backgroundColor: '#fff', // White background for the form
  borderRadius: '8px',
  boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)', // Subtle shadow for depth
});

export const ProfileForm = () => {
  const [formData, setFormData] = useState({
    location: '',
    skills: '',
    preferences: '',
    availability: '',
  });

  // Handle change in input fields
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form Data Submitted:', formData);
  };

  return (
    <FullWidthBackground>
      <FormContainer>
        <Typography variant="h5" align="center" gutterBottom>
          Complete Your Profile
        </Typography>
        <form onSubmit={handleSubmit}>
          <TextField
            label="Location"
            name="location"
            value={formData.location}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            fullWidth
            required
          />
          <TextField
            label="Skills"
            name="skills"
            value={formData.skills}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            fullWidth
            required
          />
          <TextField
            label="Preferences"
            name="preferences"
            value={formData.preferences}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            fullWidth
            multiline
            rows={4}
            required
          />
          <TextField
            label="Availability"
            name="availability"
            value={formData.availability}
            onChange={handleChange}
            variant="outlined"
            margin="normal"
            fullWidth
            required
          />
          <Button
            type="submit"
            variant="contained"
            color="secondary"
            fullWidth
            style={{ marginTop: '20px' }}
          >
            Submit
          </Button>
        </form>
      </FormContainer>
    </FullWidthBackground>
  );
};

export default ProfileForm;
